package tlb

import (
	"encoding/hex"
	"github.com/xssnick/tonutils-go/tvm/cell"
	"testing"
)

func TestBlockMaster(t *testing.T) {
	boc, _ := hex.DecodeString("")
	c, _ := cell.FromBOC(boc)

	var block Block
	if err := LoadFromCell(&block, c.BeginParse()); err != nil {
		t.Fatal(err)
	}
}

func TestBlockNotMaster(t *testing.T) {
	boc, _ := hex.DecodeString("")
	c, _ := cell.FromBOC(boc)

	var block Block
	if err := LoadFromCell(&block, c.BeginParse()); err != nil {
		t.Fatal(err)
	}
}
